ko.extenders.subTotal=function(n,t){function i(i){n.subTotal((i*t).toFixed(2))}return n.subTotal=ko.observable(),i(n()),n.subscribe(i),n};ko.observableArray.fn.total=function(){return ko.pureComputed(function(){for(var t=0,n=0;n<this().length;n++)t+=parseFloat(this()[n].quantity.subTotal());return t.toFixed(2)},this)};